# Initialize variables
$columns = 5 # Number of columns for the CSV
$lastValue = $null # Variable to store the last value in the list
$csvArray = @() # An array to store the rows
$row = @() # A single row to store column values

# Read the input file line by line
Get-Content "N2 DATA_NO-OVER-50-STAG-5.TXT" | ForEach-Object {
    $lastValue = $_ # Store the current value
    
    # Add the current value to the row
    $row += $_
    
    # If the row has the desired number of columns, add it to csvArray and reset the row
    if ($row.Count -eq $columns) {
        $csvArray += ,($row -join ",")
        $row = @()
    }
}

# If there are any remaining items in the row, fill it up with the last value
while ($row.Count -ne 0 -and $row.Count -lt $columns) {
    $row += $lastValue
}

# Add the last row if it's not empty
if ($row.Count -ne 0) {
    $csvArray += ,($row -join ",")
}

# Write the CSV data to the output file
$csvArray -join "`r`n" | Set-Content "XXX DATA-COOKED.txt"

#include <bits/stdc++.h>
#include <map>
using namespace std;

int count_digits(long long int num) {
    int ans = 0;
    while(num > 0){
        ans++;
        num/=10;
    }
    return ans;
}

long long int swap(long long int num, int i, int j){
    if(num/pow(10, i) ==0 || num/pow(10, j) == 0) return num;
    long long int id = (num / (long long int)pow(10, i)) % 10;
    long long int jd = (num / (long long int)pow(10, j)) % 10;

    num -= id * pow(10, i);
    num -= jd * pow(10, j);
    
    num += id * pow(10, j);
    num += jd * pow(10, i);

    return num;
}

int solution(vector<int> numbers){
    map<long long int, int> mp;
	long long int ans = 0;
	for(int a : numbers){
	    int d = count_digits(a);
	    set<long long int> s;
	    for(int j=0; j<d;j++) {
	        for(int k=j;k<d;k++) {
	            s.insert(swap(a, j,k));
	        }
	    }
	    for(long long int num: s) ans+=mp[num];
	    mp[a]++;
	}
	return ans;
}

import util from '../tools/utility'
