import { api } from '../boot/axios'
import header from '../common/header'
import util from '../tools/utility'

class AuthService {
  AuthLogin(data: any) {
    let config = header.authHeaderLogin()
    return api.post('/v1/auth/authenticate', data, config)
  }

  AuthLogout() {
    let config = header.authHeaderLogin()
    return api.get(`/v1/auth/logout`, config)
  }
  ChangePassword(data: any) {
    return api.post(`v1/user/force/change-password`, data)
  }

  // GetListMenu() {

  //   let config = header.authHeader(deviceId)
  //   return api.get('/adm/user/my-profile', config)
  // }
}

export default new AuthService()

import CryptoJS from 'crypto-js'

const uuid = require('device-uuid')
const keyAccess = uuid.DeviceUUID().get()

export default {
  encryption: function (data: string) {
    try {
      if (data == null) {
        return null
      } else {
        const enkripsi = CryptoJS.AES.encrypt(data, keyAccess).toString()
        return enkripsi
      }
    } catch (error) {
      console.log(error)
      return null
    }
  },
  dencrytion: function (data: null) {
    try {
      if (data == null) {
        return null
      } else {
        const bytes = CryptoJS.AES.decrypt(data!, keyAccess)
        const terjemaah = bytes.toString(CryptoJS.enc.Utf8)
        return terjemaah
      }
    } catch (error) {
      console.log(error)
      return null
    }
  },
}

