import Crypto from './crypto'
import { Notify } from 'quasar'
import { Router } from './../router/index'
import { useAuthStore } from 'src/store/auth'
class Service {
  constructor() {}

  ReadSession(key: string) {
    let read: any = localStorage.getItem(key)
    if (read == 'null') {
      return null
    } else {
      let dencrypt = Crypto.dencrytion(read)
      if (dencrypt == '' || dencrypt == undefined) {
        return null
      } else {
        let JsonToData = JSON.parse(dencrypt)
        // console.log(JsonToData)
        return JsonToData
      }
    }
  }

  SaveSession(key: string, value: any) {
    let ToJson = JSON.stringify(value)
    let encrypt = Crypto.encryption(ToJson)
    //return
    localStorage.setItem(key, encrypt === null || '' ? '' : encrypt)
    return localStorage.getItem(key)
  }

  ResponseCode(data: any) {
    let result: boolean = false
    switch (data.data.code) {
      case '00':
        result = true
        break
      case '98':
        result = true
        break
      case '01':
        result = false
        break
      case '88':
        result = false
        break
      case '99':
        result = false
        break
      case '70':
        result = false
        // setTimeout(() => {
        //     AuthService.logout();
        // }, 3000);
        break
      case 'SE':
        result = false
        // setTimeout(() => {
        //     AuthService.logout();
        // }, 3000);
        break
      default:
        result = false
        break
    }
    return result
  }

  Errorhandling(e: any) {
    window.console.log(e.response.data)
    const authStore = useAuthStore()
    if (e.response.data.responseCode == '99') {
      window.console.log(authStore)
      this.NotifyError(e.response.data.message)
      // authStore.logout()
      return this.PagesRouter('/')
    }
  }

  NotifySuccess(message: any) {
    return Notify.create({
      position: 'top-right',
      color: 'positive',
      icon: 'check_circle',
      message: message,
      timeout: 5000,
    })
  }
  NotifyInfo(message: any) {
    return Notify.create({
      position: 'top-right',
      color: 'info',
      icon: 'info',
      message: message,
      timeout: 5000,
    })
  }
  NotifyWarning(message: any) {
    return Notify.create({
      position: 'top-right',
      color: 'warning',
      icon: 'warning',
      message: message,
      timeout: 5000,
    })
  }
  NotifyError(message: any) {
    return Notify.create({
      position: 'top-right',
      color: 'negative',
      icon: 'error',
      message: message,
      timeout: 5000,
    })
  }

  toPage(router: any, pages: any) {
    return router.push(pages)
  }

  PagesRouter(pages: string) {
    return Router.push(pages)
  }
  static phoneRules() {
    return (val: any) => {
      const cleanedPhoneNumber = val.replace(/-/g, '')
      if (cleanedPhoneNumber.length == 0) {
        return 'Mobile phone number is required'
      }

      if (cleanedPhoneNumber.startsWith('62')) {
        if (cleanedPhoneNumber.length < 11) {
          // console.log(cleanedPhoneNumber, "phone");
          return 'Phone number must be at least 11 characters long'
        } else {
          return true
        }
      } else {
        if (cleanedPhoneNumber.length < 10) {
          return 'Phone number must be at least 10 characters long'
        } else {
          return true
        }
      }
      // return true;
    }
  }
  static convertPhoneNumber(phone: any) {
    const cleanedNumber = phone.replace(/\D/g, '')
    if (cleanedNumber.startsWith('62')) {
      return (phone = '0' + cleanedNumber.slice(2))
    } else {
      return cleanedNumber
    }
  }
}

export default new Service()

import { boot } from 'quasar/wrappers'
import axios, { AxiosInstance } from 'axios'
import { LocalStorage } from 'quasar'
import { AUTH_TOKEN_LOCAL } from 'src/constants/auth'
import utility from 'src/tools/utility'
import { useRouter } from 'vue-router'
import { Router } from 'src/router'
import { useAuthStore } from 'src/store/auth'

declare module '@vue/runtime-core' {
  interface ComponentCustomProperties {
    $axios: AxiosInstance
  }
}

// Be careful when using SSR for cross-request state pollution
// due to creating a Singleton instance here;
// If any client changes this (global) instance, it might be a
// good idea to move this instance creation inside of the
// "export default () => {}" function below (which runs individually
// for each client)
// const api = axios.create({ baseURL: 'https://api.example.com' });
const api = axios.create({ baseURL: process.env.API_URL })

api.interceptors.request.use(function (config) {
  const token = LocalStorage.getItem(AUTH_TOKEN_LOCAL)
  // console.log(utility.ReadSession(AUTH_TOKEN_LOCAL))
  if (token) {
    config.headers.common.Authorization =
      'Bearer ' + utility.ReadSession(AUTH_TOKEN_LOCAL)
  }
  return config
})

api.interceptors.response.use(
  function (response) {
    api.defaults.headers.post['Content-Type'] =
      'application/x-www-form-urlencoded'
    return response
  },
  function (error) {
    return Promise.reject(error)
    // return Promise.reject(error)
  }
)

export default boot(({ app, router }) => {
  const $router = useRouter()

  // for use inside Vue files (Options API) through this.$axios and this.$api

  app.config.globalProperties.$axios = axios
  // ^ ^ ^ this will allow you to use this.$axios (for Vue Options API form)
  //       so you won't necessarily have to import axios in each vue file

  app.config.globalProperties.$api = api
  // ^ ^ ^ this will allow you to use this.$api (for Vue Options API form)
  //       so you can easily perform requests against your app's API

  api.interceptors.response.use(
    function (response) {
      return response
    },
    function (error) {
      const authStore = useAuthStore()
      const route = router.options.routes[0].name
      if (error.response.status === 401) {
        authStore.setIsLoggedin(false)
        localStorage.clear()
        router.push({ name: 'login' })
        // this.$router.go();

        // if (route !== "login") {
        //   utility.notifySuccess("Login Expired");
        // }
      }
      return Promise.reject(error)
    }
  )
})

export { api }

package fullweek2;

public class Day10D {
    int iNum1 = 12;
    static int sNum1 = 15;
    
    public static void main(String[] args) {
        Day10D callMe1 = new Day10D();
        Day10D callMe2 = new Day10D();
        System.out.println("snum1: " + sNum1);
        System.out.println("callMe1 num1: " + callMe1.iNum1);
        System.out.println("callMe2 num1: " + callMe2.iNum1);
        
        System.out.println("sNum1 + callMe1.iNum1 = " + (sNum1 + callMe1.iNum1));
        System.out.println("current: callMe2.iNum1 = 18");
        callMe2.iNum1 = 18;
        System.out.println("sNum1 + callMe2.iNum1 = " + (sNum1 + callMe2.iNum1));
        System.out.println("sNum1 = 4");
        sNum1 = 4;
        System.out.println("sNum1 + callMe1.iNum1 = " + (sNum1 + callMe1.iNum1));
        System.out.println("sNum1 + callMe2.iNum1 = " + (sNum1 + callMe2.iNum1));
    }
}

