#define _GNU_SOURCE

#include <string.h>
#include <unistd.h>
#include <fcntl.h>

int main(int argc, char *argv[])
{
	char *filename, *mode;
	int fd, flags = O_PATH;

	if (argc < 3)
		return 1;

	filename = argv[1];
	mode = argv[2];

	if (!strcmp(mode, "r"))
		flags = O_RDONLY;
	else if (!strcmp(mode, "w"))
		flags = O_WRONLY;
	else if (!strcmp(mode, "rw"))
		flags = O_RDWR;

	for (int i = 0; i < 1000000; i++) {
		fd = open(filename, flags);
		close(fd);
	}

	return 0;
}

