#include <boost/spirit/home/x3.hpp>
#include <boost/spirit/home/x3/binary.hpp>
#include <boost/spirit/include/support_istream_iterator.hpp>

#include <array>
#include <optional>
#include <iostream>
#include <sstream>

struct KernelDeclaration
{
    std::array<int, 3> requiredWorkgroupSize = {0};
};

// –¥–µ–π—Å—Ç–≤–∏—è —Å–µ–º–∞–Ω—Ç–∏–∫–∏ –ø–∞—Ä—Å–µ—Ä–∞ (semantic actions)
namespace attribute::parser
{

auto kernel_decl_parsed = [](auto &ctx)
{
    KernelDeclaration result;
    result.requiredWorkgroupSize[0] = boost::fusion::at_c<0>(_attr(ctx));
    result.requiredWorkgroupSize[1] = boost::fusion::at_c<1>(_attr(ctx));
    result.requiredWorkgroupSize[2] = boost::fusion::at_c<2>(_attr(ctx));

    _val(ctx) = std::move(result);
};

} // namespace attribute::parser

// –≥—Ä–∞–º–º–∞—Ç–∏–∫–∞ –ø–∞—Ä—Å–µ—Ä–∞.
namespace attribute::parser
{
namespace x3 = boost::spirit::x3;

const x3::rule<class R_Kernel_Decl, KernelDeclaration> kernel_decl = "kernel-declaration";

const auto req_work_group_size =
        x3::lit("reqd_work_group_size(")
        >> x3::int32
        >> "," >> x3::int32
        >> "," >> x3::int32
        >> ")";

const auto kernel_decl_def =
        (x3::lit("__attribute__((")
         >> req_work_group_size
         >> "))"
        )[kernel_decl_parsed];

BOOST_SPIRIT_DEFINE(kernel_decl)

} // namespace attribute::parser

namespace attribute
{

std::optional<KernelDeclaration>
parse(std::istream &in)
{
    in.unsetf(std::ios::skipws);
    boost::spirit::istream_iterator b(in), e;

    KernelDeclaration result;

    auto res = boost::spirit::x3::parse(
                       b,
                       e,
                       parser::kernel_decl,
                       result
               )
            && (b == e); // –¥–æ–ø –ø—Ä–æ–≤–µ—Ä–∫–∞, —á—Ç–æ –≤—Ö–æ–¥–Ω—ã–µ –¥–∞–Ω–Ω—ã–µ —Å—á–∏—Ç–∞–Ω—ã —Ü–µ–ª–∏–∫–æ–º

    if (res)
    {
        return result;
    }
    else
    {
        return {};
    }
}

} // namespace attribute

int
main(int argc, char *argv[])
{
    std::stringstream input_data {};
    input_data << "__attribute__((reqd_work_group_size(1,2,3)))";
    auto kernel_decl = attribute::parse(input_data);

    if (kernel_decl.has_value())
    {
        size_t id = 0;
        for (const auto i : kernel_decl.value().requiredWorkgroupSize)
        {
            std::cout
                    << "KernelDeclaration.requiredWorkgroupSize"
                    << "[" << id++ << "] = " << i << std::endl;
        }
    }
    else
    {
        std::cerr << "Wrong kernel declaration syntax!" << std::endl;
    }

    return EXIT_SUCCESS;
}

